import React from 'react'
import {Avatar, Card} from 'antd';

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div> </div>
      ]}
    >
      <Card.Meta
        avatar={<Avatar>SH</Avatar>}
        title="SuWan"
      />
    </Card>
  )
}

export default UserProfile
